import React from "react";
// import { makeStyles } from "@material-ui/core/styles";
// import Pagination from '@material-ui/lab/Pagination';
// import AddIcon from "@material-ui/icons/Add";
// import Tooltip from "@material-ui/core/Tooltip";
// import Fab from "@material-ui/core/Fab";
import DeleteIcon from "@material-ui/icons/Delete";
import EditIcon from "@material-ui/icons/Edit";
import VisibilityIcon from "@material-ui/icons/Visibility";
import {
  Typography,
  Input,
  Box,
  Button,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Paper,
  Avatar,
} from "@material-ui/core";

// const useStyles = makeStyles({
//     table: {

//         marginTop:"50px",
//       paddingLeft: "200px",
//       paddingRight: "20px",
//       minWidth: 650,
//     },
//   });

const createData = (roll_no, first_name, last_name, grade, age, salary) => {
    return { roll_no, first_name, last_name, grade, age, salary };
  };

  const rows = [
    createData(101, "Aarati", "Pulami", "A", 42, 20000),
    createData(102, "Sujata", "Nepal", "B+", 27, 30000),
    createData(103, "Harrr", "Pahari", "A", 26, 65000),
    createData(104, "Ashok", "Bashyal", "A+", 30, 58000),
    createData(105, "Bikky", "Chhetri", "A-", 26, 85000),
    createData(106, "Rajesh", "Nepal", "A+", 36, 67000),
  ];

  export default function DemoTable() {
    // const classes = useStyles();
      return(
          <Box>
        <TableContainer
        component={Paper}
        style={{ marginTop: "60px", marginLeft: "50px", marginRight:"50px",width: "95%" }}
      >
        <Table
        //   className={classes.table}
          size="small"
          aria-label="a dense table"
          style={{ width: "1200px"  }}
        >
          <TableHead>
            <TableRow>
              <TableCell>Image</TableCell>
              <TableCell align="center">Roll no</TableCell>
              <TableCell align="center">First Name</TableCell>
              <TableCell align="center">Last Name</TableCell>
              <TableCell align="center">Grade</TableCell>
              <TableCell align="center">Age</TableCell>
              <TableCell align="center">Salary</TableCell>
              <TableCell align="center">Action</TableCell>
            </TableRow>
          </TableHead>

          <TableBody>
            {rows.map((row) => (
              <TableRow key={row.id}>
                <TableCell component="th" scope="student">
                  <Avatar alt="Image" src={row.image} />
                </TableCell>
                <TableCell align="center">{row.roll_no}</TableCell>
                <TableCell align="center">{row.first_name}</TableCell>
                <TableCell align="center">{row.last_name}</TableCell>
                <TableCell align="center">{row.grade}</TableCell>
                <TableCell align="center">{row.age}</TableCell>
                <TableCell align="center">{row.salary}</TableCell>
                <TableCell align="center">

                  <EditIcon />
                  <DeleteIcon />
                </TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
   </Box>

);
  }
